import { Component } from '@angular/core';
import { MatCardModule } from '@angular/material/card';
import { MatChipsModule } from '@angular/material/chips';
import { NgxChartsModule } from '@swimlane/ngx-charts';

@Component({
  selector: 'app-package',
  standalone: true,
  imports: [MatCardModule, MatChipsModule, NgxChartsModule],
  templateUrl: './package.component.html',
  styleUrls: ['./package.component.css'],
})
export class PackageComponent {
  single: any[];
  multi: any[] = [];
  view: any[] = [150, 150];

  // Pie chart options
  showLegend = true;
  legendPosition = 'below';
  explodeSlices = false;
  doughnut = false;
  arcWidth = 0.25;
  labelText = '{value}%';
  gradient = true;

  constructor() {
    // Define pie chart data
    this.single = [
      {
        name: 'Germany',
        value: 2,
      },
    ];
  }

  // Handle chart slice selection event
  onSelect(event: any) {
    console.log(event);
  }
}
<mat-card class="package">
  <mat-card-header>
    <mat-card-subtitle
      ><mat-chip color="primary">
        <img
          matChipAvatar
          src="https://material.angular.io/assets/img/examples/shiba1.jpg"
          alt="Photo of a Shiba Inu"
        />
        Package Type
      </mat-chip></mat-card-subtitle
    >
    <mat-card-title>Package Name</mat-card-title>
  </mat-card-header>
  <mat-card-content>
    <p>content</p>
    <ngx-charts-pie-grid [view]="[150, 150]" [results]="single">
    </ngx-charts-pie-grid>
  </mat-card-content>
</mat-card>
